import React from 'react';
import { NavLink } from 'react-router-dom';
import { Icon } from '../../icon';

const HomeBar = () => {

    const IsActive = ({ isActive }) => { return "px-3 py-3  rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal group hover:bg-linkHover " + (isActive ? "fw-bold bg-linkHover" : "text-link") }
    return (
        <NavLink to={"/"} className={IsActive}>
            <div className='group-hover:scale-[1.1] duration-150'>
                <Icon name="home" />
            </div>
            <span>Ana Sayfa</span>
        </NavLink>
    );
};

export default HomeBar;
